import React from 'react'
import "../styles.css";
import LikedQuote from "./LikedQuote";

const Block = (props) => {
    const value = props;
    return (
        <div>
            <LikedQuote value={value}/>
            <div>{props.value}</div>
        </div>
    )
}

export default Block
